// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginForm from './components/LoginForm';
import CreateAccount from './components/CreateAccount';
import Dashboard from './components/Dashboard';
import Fitnes1 from './components/Fitnes1';
import Fitnes2 from './components/Fitnes2';
import Fitnes3 from './components/Fitnes3';
import Fitnes4 from './components/Fitnes4';
import Fitnes5 from './components/Fitnes5';
import Fitnes6 from './components/Fitnes6';
import Fitnes7 from './components/Fitnes7';
import Fitnes8 from './components/Fitnes8';
import Fitnes9 from './components/Fitnes9';
import Fitnes10 from './components/Fitnes10';
import Fitnes11 from './components/Fitnes11';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LoginForm />} />
        <Route path="/create-account" element={<CreateAccount />} />
        <Route path="/Dashboard" element={<Dashboard />} />
        <Route path="/fitnes1" element={<Fitnes1 />} />
        <Route path="/fitnes2" element={<Fitnes2 />} />
        <Route path="/fitnes3" element={<Fitnes3 />} />
        <Route path="/fitnes4" element={<Fitnes4 />} />
        <Route path="/fitnes5" element={<Fitnes5 />} />
        <Route path="/fitnes6" element={<Fitnes6 />} />
        <Route path="/fitnes7" element={<Fitnes7 />} />
        <Route path="/fitnes8" element={<Fitnes8 />} />
        <Route path="/fitnes9" element={<Fitnes9 />} />
        <Route path="/fitnes10" element={<Fitnes10 />} />
        <Route path="/fitnes11" element={<Fitnes11 />} />
      </Routes>
    </Router>
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
